import React from 'react';
import '../../css/admin.css';

function Home(props){
    return(
        <div>
            <h1>Admin Panel</h1>
            <button className="admin-button" onClick={() => props.history.push('/admin/add')}>
                <div >Add</div>
            </button><br/>
            <button onClick={() => props.history.push('/admin/books')}>
                <div className="admin-button">Modify</div>                
            </button>           
        </div>
    );
}

export default Home;
